import { describe, test, TestContext } from "node:test";
import { createProvider } from "../providers/providers";
import { createApp, createModule } from "..";

describe("describeTree", () => {
  test("root with child, grandchild, and sibling modules + providers", async (t: TestContext) => {
    t.plan(1);

    const grandChildProvider = createProvider({
      name: "grandChildProv",
      expose: () => ({ x: 1 }),
    });

    const siblingProvider = createProvider({
      name: "siblingProv",
      lifecycle: "transient",
      expose: () => ({ y: 2 }),
    });

    const siblingDependent = createProvider({
      name: "siblingDependent",
      deps: { siblingProvider },
      expose: ({ siblingProvider }) => ({ z: siblingProvider.y + 1 }),
    });

    const grandChild = createModule({
      name: "grandchild",
      providers: { grandChildProvider },
    });

    const child = createModule({
      name: "child",
      subModules: [grandChild],
    });

    const sibling = createModule({
      name: "sibling",
      encapsulate: false,
      providers: { siblingProvider, siblingDependent },
    });

    const root = createModule({
      name: "root",
      subModules: [child, sibling],
    });

    const app = await createApp({ root });
    const tree = app.describeTree();

    const expected = String.raw`🌳 mod root@m\d+ \(encapsulate=true\)
  📦 mod child@m\d+ \(encapsulate=true\)
    📦 mod grandchild@m\d+ \(encapsulate=true\)
      ⚙️ prov grandChildProv@p\d+ \[singleton\]
  📦 mod sibling@m\d+ \(encapsulate=false\)
    ⚙️ prov siblingProv@p\d+ \[transient\]
    ⚙️ prov siblingDependent@p\d+ \[singleton\]
`;

    // add a trailing newline for match alignment
    t.assert.match(tree + "\n", new RegExp(expected));

    await app.close();
  });
});

import type { FastifyInstance } from "fastify";
import { Container } from "../container";

// eslint-disable-next-line @typescript-eslint/no-explicit-any
export type BivariantCallback<T extends (...args: any) => any> =
  { bivarianceHack: T }["bivarianceHack"];

export type ProviderLifecycle = "singleton" | "transient";

// eslint-disable-next-line @typescript-eslint/no-explicit-any
export type ProviderAny = ProviderDef<any, any>;

export type BaseProviderDepsMap = Record<string, ProviderAny>;
export type DepValues<ProviderDepsMap extends BaseProviderDepsMap> = {
  [K in keyof ProviderDepsMap]: Awaited<
    ReturnType<ProviderDepsMap[K]["expose"]>
  >;
};

type ProviderHook<D extends BaseProviderDepsMap, V> =
  BivariantCallback<(ctx: {
    fastify: FastifyInstance;
    deps: DepValues<D>;
    value: V;
  }) => unknown | Promise<unknown>>;

export interface ProviderDef<
  ProviderDepsMap extends BaseProviderDepsMap = BaseProviderDepsMap,
  Value = unknown,
> {
  name: string;
  lifecycle: ProviderLifecycle;
  deps: ProviderDepsMap;

  expose: (deps: DepValues<ProviderDepsMap>) => Value | Promise<Value>;

  onReady?: ProviderHook<ProviderDepsMap, Value>;
  onClose?: ProviderHook<ProviderDepsMap, Value>;

  resolve: () => Promise<Value>;

  _prov?: never;
}

const kProviderId = Symbol("fastify-di:providerId");
let __seq = 0;
const nextId = () => `p${(++__seq)}`;

/**
 * This is not a predictible id.
 */
export function getProviderId(provider: ProviderAny): string {
  return (provider as never)[kProviderId];
}

export function createProvider<
  const ProviderDepsMap extends BaseProviderDepsMap,
  Value,
>(def: {
  name: string;
  lifecycle?: ProviderLifecycle;
  deps?: ProviderDepsMap;
  expose: (deps: DepValues<ProviderDepsMap>) => Value | Promise<Value>;
  onReady?: ProviderHook<ProviderDepsMap, Value>;
  onClose?: ProviderHook<ProviderDepsMap, Value>;
}): ProviderDef<ProviderDepsMap, Value> {
  const self: ProviderDef<ProviderDepsMap, Value> = {
    name: def.name,
    lifecycle: def.lifecycle ?? "singleton",
    deps: (def.deps ?? {}) as ProviderDepsMap,
    expose: def.expose,
    onReady: def.onReady,
    onClose: def.onClose,
    resolve: async () => new Container().get(self),
  };

  Object.defineProperty(self, kProviderId, {
    value: nextId(),
    enumerable: false,
  });


  return self;
}

export async function resolveDeps(container: Container, prov: ProviderAny) {
  const deps = prov.deps;
  const out: Record<string, unknown> = {};
  for (const [k, p] of Object.entries(deps)) {
    out[k] = await container.get(p as ProviderAny);
  }

  return out;
}

import Fastify, {
  type FastifyInstance,
  type FastifyServerOptions,
} from "fastify";

export * from "./providers/providers";
export * from "./modules/module";
export * from "./container";

import { getModuleId, registerModule, type ModuleAny } from "./modules/module";
import { getProviderId, resolveDeps, type ProviderAny } from "./providers/providers";
import { Container } from "./container";
import { describeTree } from "./printer/describe-tree";

export interface CreateAppOptions {
  serverOptions?: FastifyServerOptions;
  root: ModuleAny;
}

declare module "fastify" {
  export interface FastifyInstance {
    describeTree: () => string;
  }
}

type InstancesMap = Map<string, string>;

export async function createApp({
  serverOptions,
  root,
}: CreateAppOptions): Promise<FastifyInstance> {
  const fastify = Fastify(serverOptions);

  const moduleNameToId: InstancesMap = new Map();
  const providerNameToId: InstancesMap = new Map();

  const allProviders = new Set<ProviderAny>();
  walkModules(root, (m) => {
    ensureModuleNameUnicity(moduleNameToId, m);
    Object.values(m.providers).forEach((p) => {
      walkProviders(p as ProviderAny, (pp) => {
        ensureProviderNameUnicity(providerNameToId, pp as ProviderAny);
        allProviders.add(pp as ProviderAny);
      });
    });
  });

  const container = new Container();

  await registerModule(fastify, root, container);

  fastify.addHook("onReady", async () => {
    for (const prov of allProviders) {
      if (!prov.onReady) {
        continue;
      }

      const deps = await resolveDeps(container, prov);
      const value = await container.get(prov);
      await prov.onReady({ fastify, deps: deps, value: value });
    }
  });

  fastify.addHook("onClose", async () => {
    for (const prov of allProviders) {
      if (!prov.onClose) {
        continue;
      }

      const deps = await resolveDeps(container, prov);
      const value = await container.get(prov);
      await prov.onClose({ fastify, deps: deps, value: value });
    }
  });

  fastify.decorate("describeTree", () => describeTree(root));

  await fastify.ready();

  return fastify;
}

function walkModules(m: ModuleAny, visit: (m: ModuleAny) => void): void {
  visit(m);
  for (const s of m.subModules) {
    walkModules(s, visit);
  }
}

function walkProviders(p: ProviderAny, visit: (p: ProviderAny) => void): void {
  visit(p);
  for (const dep of Object.values(p.deps)) {
    walkProviders(dep as ProviderAny, visit);
  }
}

function ensureModuleNameUnicity(map: InstancesMap, mod: ModuleAny): void {
  const id = getModuleId(mod);
  const existing = map.get(mod.name);
  if (!existing) {
    map.set(mod.name, id);
    return;
  }
  if (existing !== id) {
    throw new Error(
      `Duplicate module name "${mod.name}" bound to different instances: ${existing} vs ${id}.`,
    );
  }
}

function ensureProviderNameUnicity(map: InstancesMap, p: ProviderAny): void {
  const id = getProviderId(p);
  const existing = map.get(p.name);
  if (!existing) {
    map.set(p.name, id);
    return;
  }

  if (existing !== id) {
    throw new Error(
      `Duplicate provider name "${p.name}" bound to different instances: ${existing} vs ${id}.`,
    );
  }
}

import type {
  DepValues,
  ProviderAny,
  ProviderDef,
  BaseProviderDepsMap,
} from "./providers/providers";

export class Container {
  private singletons = new WeakMap<object, Promise<unknown>>();

  async get<ProviderDepsMap extends BaseProviderDepsMap, Value>(
    provider: ProviderDef<ProviderDepsMap, Value>,
  ): Promise<Value> {
    if (provider.lifecycle === "transient") {
      return this.instantiate(provider);
    }

    let value = this.singletons.get(provider) as Promise<Value> | undefined;
    if (!value) {
      value = this.instantiate(provider);
      this.singletons.set(provider, value);
    }

    return value;
  }

  private async instantiate<ProviderDepsMap extends BaseProviderDepsMap, Value>(
    provider: ProviderDef<ProviderDepsMap, Value>,
  ): Promise<Value> {
    const depsEntries = Object.entries(provider.deps) as [
      string,
      ProviderAny,
    ][];

    const depsObj: Record<string, unknown> = {};
    for (const [k, p] of depsEntries) {
      depsObj[k] = await this.get(p);
    }

    return provider.expose(depsObj as DepValues<ProviderDepsMap>);
  }
}

import { getModuleId, type ModuleAny } from "../modules/module";
import { getProviderId, type ProviderAny } from "../providers/providers";

const useColor = () => process.stdout.isTTY;
const wrap = (code: number, s: string, enabled: boolean) => {
    /* c8 ignore next - Only used by CLI */
    return enabled ? `\x1b[${code}m${s}\x1b[0m` : s;
}

const c = (enabled: boolean) => ({
  dim: (s: string) => wrap(2, s, enabled),
  cyan: (s: string) => wrap(36, s, enabled),
  green: (s: string) => wrap(32, s, enabled),
  yellow: (s: string) => wrap(33, s, enabled),
});

export function describeTree(root: ModuleAny): string {
  const lines: string[] = [];
  const col = c(useColor());

  (function walk(m: ModuleAny, depth: number, isRoot = false) {
    const pad = "  ".repeat(depth);
    const emoji = isRoot ? "🌳" : "📦";

    lines.push(
      `${pad}${emoji} ${col.dim("mod")} ` +
        `${col.cyan(`${m.name}@${getModuleId(m)}`)} ` +
        `${col.dim(`(encapsulate=${m.encapsulate !== false})`)}`,
    );

    for (const p of Object.values(m.providers) as ProviderAny[]) {
      const life = p.lifecycle;
      const lifeCol = life === "transient" ? col.yellow(life) : col.green(life);
      lines.push(
        `${pad}  ⚙️ ${col.dim("prov")} ` +
          `${col.cyan(`${p.name}@${getProviderId(p)}`)} ` +
          `[${lifeCol}]`,
      );
    }
    for (const s of m.subModules) walk(s, depth + 1);
  })(root, 0, true);

  return lines.join("\n");
}

import type { FastifyInstance } from "fastify";
import fp from "fastify-plugin";
import type { ProviderAny } from "../providers/providers";
import type { Container } from "../container";

export type ProviderValues<
  Providers extends Readonly<Record<string, ProviderAny>>,
> = {
  [K in keyof Providers]: Awaited<ReturnType<Providers[K]["expose"]>>;
};

export interface ModuleDef<
  Providers extends Readonly<Record<string, ProviderAny>> = Readonly<
    Record<string, ProviderAny>
  >,
  SubModules extends ReadonlyArray<ModuleAny> = ReadonlyArray<ModuleAny>,
> {
  name: string;
  providers: Providers;
  subModules: SubModules;
  encapsulate: boolean;
  accessFastify?: (ctx: {
    fastify: FastifyInstance;
    deps: {
      [K in keyof Providers]: Awaited<ReturnType<Providers[K]["expose"]>>;
    };
  }) => unknown | Promise<unknown>;
  _mod?: never;
}

// eslint-disable-next-line @typescript-eslint/no-explicit-any
export type ModuleAny = ModuleDef<any, any>;

const kModuleId = Symbol("fastify-di:moduleId");
let __seq = 0;
const nextId = () => `m${(++__seq)}`;

/**
 * This is not a predictible id.
 */
export function getModuleId(mod: ModuleAny): string {
  return (mod as never)[kModuleId];
}

export function createModule<
  const Providers extends Readonly<Record<string, ProviderAny>>,
  const SubModules extends ReadonlyArray<ModuleAny>,
>(def: {
  name: string;
  providers?: Providers;
  subModules?: SubModules;
  encapsulate?: boolean;
  accessFastify?: (ctx: {
    fastify: FastifyInstance;
    deps: {
      [K in keyof Providers]: Awaited<ReturnType<Providers[K]["expose"]>>;
    };
  }) => unknown | Promise<unknown>;
}): ModuleDef<Providers, SubModules> {
  const self = {
    name: def.name,
    providers: (def.providers ?? {}) as Providers,
    subModules: (def.subModules ?? []) as SubModules,
    encapsulate: def.encapsulate ?? true,
    accessFastify: def.accessFastify,
  };

  Object.defineProperty(self, kModuleId, {
    value: nextId(),
    enumerable: false,
  });

  return self;
}

export async function registerModule(
  fastify: FastifyInstance,
  mod: ModuleAny,
  container: Container,
): Promise<void> {
  const plugin = async (instance: FastifyInstance) => {
    const localValues = await resolveProviderMap(container, mod.providers);
    if (mod.accessFastify) {
      await mod.accessFastify({ fastify: instance, deps: localValues });
    }

    for (const sub of mod.subModules) {
      await registerModule(instance, sub, container);
    }
  };

  await fastify.register(
    fp(plugin, {
      name: `mod:${mod.name}@${getModuleId(mod)}`,
      encapsulate: mod.encapsulate,
    }),
  );
}

async function resolveProviderMap(
  container: Container,
  map: Readonly<Record<string, ProviderAny>>,
) {
  const out: Record<string, unknown> = {};
  for (const [k, p] of Object.entries(map)) {
    out[k] = await container.get(p);
  }

  return out;
}
